import axios from 'axios';
import { GET_NOTICE_LIST } from './actionTypes';

//异步获得通知列表的界面
export const getList = (id) => {
	return (dispatch) => {
		axios.get('/get' + id).then((res) => {
			const result = res.data.data;
			console.log(result)
			const action = {
				type: GET_NOTICE_LIST,
				name: result[0].name,
				url: result[0].url,
			}
			dispatch(action);
		})
	}
}
